def two_sum(nums, target):
    results = []

    def findSumFrom(current_index, nums, target):
        level_result = []
        first_num = nums[current_index]
        level_result.append(current_index + 1)
        for i in range(len(nums)):
            if i == current_index:
                continue
            if first_num + nums[i] == target:
                level_result.append(i + 1)
                return level_result
        return None

    for i in range(len(nums)):
        temp = findSumFrom(i, nums, target)
        if temp:
            results = temp
            break

    return results


def twoSum (numbers, target):
    left = 0
    right = len(numbers) - 1
    while left<= right:
        current_sum = numbers[left] + numbers[right]
        if current_sum == target:
            return [left + 1, right + 1]
        elif current_sum < target:
            left += 1
        else: 
            right -= 1    
    


